async function processMerges(positions,delay) {
    const positionMap = new Map(positions.map(p => [p.id, p]));
    let hodlerPosition = null
    while (true) {
        positions = Array.from(positionMap.values());
        const pairs = formatPairs(positions.filter(row=>row.level !== 0));
        if (pairs.length === 0) {
            break;
        }
        pairs.sort((a, b) => a[0].level - b[0].level)
        const firstPair = pairs[0]
        hodlerPosition = null

        for (var i = 0; i < positions.length; i++) {
          const row = positions[i]
          const { position, id, level } = row
          if (!isInPair(firstPair, id)) {
              G.showRect(position,delay,level ? "blue":"red",level)
          }
        }

        for (const [start, end] of [firstPair]) {
            G.showRect(start.position,delay,"green",start.level)
            G.showRect(end.position,delay, "yellow",start.level)
            await drawArrowLine(end,start,true,delay)
            start.level = start.level + 1
            positionMap.set(start.id, start);
            await G.sleep(0.1)
            positions.sort((a,b)=>b.id - a.id)

            let row
            let noZeroPoitions = 0
            for (var i = 0; i < positions.length; i++) {
              const row1 = positions[i]
              if(row1.level !== 0 && row1.id !== start.id && row1.id !== end.id && row1.id > end.id && !row){
                row = row1
              }
              if(row1.level > 0){
                noZeroPoitions += 1
              }
              G.showRect(row1.position,delay,row1.level ? "blue":"red",row1.level)
            }

            if(row && noZeroPoitions < 8){
              G.showRect(row.position,delay,"yellow",row.level)
              G.showRect(end.position,delay,"green",0)
              await drawArrowLine(row,end,true,delay)
              end.level = row.level
              positionMap.set(end.id, end);
              row.level = 0
              positionMap.set(row.id, row);
            }else{
              end.level = 0
              positionMap.set(end.id, end);
            }
            await F("#12").click();
        }
    }

    return Array.from(positionMap.values());
}

const formatPairs = (positions) => {
    positions.sort((a, b) => a.level - b.level);
    const grouped= {};
    for (const position of positions) {
        if (!grouped[position.level]) {
            grouped[position.level] = [];
        }
        grouped[position.level].push(position);
    }

    const result= [];

    for (const level in grouped) {
        const items = grouped[level];
        if (items.length % 2 !== 0) {
            items.pop();
        }
        for (let i = 0; i < items.length; i += 2) {
            result.push([items[i], items[i + 1]]);
        }
    }

    return result;
};

